package org.walkframework.base.system.task.notify;import java.io.Serializable;  public class NotifyRsp implements Serializable {	private static final long serialVersionUID = 1L;	 /**		 *通知流水		 */		private String notifyId;	 /**		 *反馈类型。0：不等待反馈；1：等待反馈。当为等待时，接收方收到通知后需在通知url中反馈处理结果		 */		private String rspType;	 /**		 *反馈状态。0：失败；1：成功		 */		private String rspState;	 /**		 *反馈内容		 */		private String rspContent;	public String getNotifyId() {		return notifyId;	}	public void setNotifyId(String notifyId) {		this.notifyId = notifyId;	}	public String getRspType() {		return rspType;	}	public void setRspType(String rspType) {		this.rspType = rspType;	}	public String getRspState() {		return rspState;	}	public void setRspState(String rspState) {		this.rspState = rspState;	}	public String getRspContent() {		return rspContent;	}	public void setRspContent(String rspContent) {		this.rspContent = rspContent;	}}